@andrewbell_8 Howdy!

Typically you are going to be reading in already created files (like a .CSV or .xls). So you could use Excel to create the data, but then use R for the analysis as it can do more and with bigger data.

I do think it's worth learning about #rstats for the analysis portion!

Trigger a segfault in #RStats using xml2

for (i in 1:500){  
  doc &lt;- xml2::read_xml("&lt;a&gt;&lt;b&gt;a&lt;/b&gt;&lt;/a&gt;")
  children &lt;- xml2::xml_children(doc)
  xml2::xml_add_parent(children, xml2::read_xml('&lt;c&gt;d&lt;/c&gt;'))
}

